mapper.select:

select 

from jvd_chokyoshi_seiseki
where CHOKYOSHI_CODE = #{chokyoshiCode,jdbcType=CHAR}
  and SETTEI_NEN = #{setteiNen,jdbcType=DECIMAL}

mapper.delete:

delete from jvd_chokyoshi_seiseki
where CHOKYOSHI_CODE = #{chokyoshiCode,jdbcType=CHAR}
  and SETTEI_NEN = #{setteiNen,jdbcType=DECIMAL}
